import { TypeAnimation } from 'react-type-animation';

const Home = () => {
  return (
    <div>
          <a className="top-0 " id="Home"></a>
    <div className="relative text-white h-screen w-screen flex flex-col mt-64 ml-32 text-5xl p-10">
      <h1>Hi I'm Alex</h1>
        <TypeAnimation
          sequence={[
            // Same substring at the start will only be typed out once, initially
            'Software Engineer',
            1000, // wait 1s before replacing "Mice" with "Hamsters"
            'Full-Stack Developer',
            1000,
            'Fitness Enthusiast',
            1000,
          ]}
          wrapper="span"
          className='text-base italic'
          speed={20}
          repeat={Infinity}
        />
        <button className='text-md'>About Me</button>        
    </div>
    </div>

  );
}

export default Home;
